import React, { useState, useEffect } from 'react'
import axios from 'axios'

function User() {

    const [user, setUser] = useState(null)

    useEffect(() => {
        axios({
            method: 'get',
        }).then(response => {
            setUser(response.data);
            console.log(user)
        })
    }, ['http://127.0.0.1:8000/users'])
    
    return (
        <div>
            <h1>The user page</h1>
        </div>
    )
}

export default User
